  false,\n\t\"url\": null,\n\t\"notes\": \" Shrimp trapping operations were conducted
  by NOAA research vessel Townsend Cromwell from 1980 to 1989 in the Central and Western
  Pacific Ocean to determine availability, catchability, distribution and relative
  abundance of deep water shrimp. And a Guam chartered vessel, Pesquedot, conducted
  shrimp trapping operation in waters off Guam in 1984.nCatch and effort data, including
  counts and weights of deep water shrimp caught were collected.\",\n\t\"license_title\":
